import { Component } from "react";
import Nav from "./conponents/Nav/Nav.jsx";
import DialogF from "./conponents/Dialogs/Message/DialogF.jsx";
import "./App.css";
import { Route, withRouter } from "react-router-dom";
import UsersC from "./conponents/New/NewC";
import ProfileC from "./conponents/Profile/ProfileC";
import HeaderC from "./conponents/Header/HeaderC";
import Login from "./Login/login";
import { connect } from "react-redux";
import { initializedPageApp } from "./redux/authApp";
import { compose } from "redux";
import Preloader from "./conponents/common/Prealoader/Preloader";

class App extends Component {
  componentDidMount() {
    this.props.initializedPageApp();
  }

  render() {
    if (!this.props.initialized) {
      return <Preloader />;
    }

    return (
      <div className="App">
        <HeaderC />
        <Nav />
        <Route path="/dialog" render={() => <DialogF />} />
        <Route path="/profile/:userid?" render={() => <ProfileC />} />
        <Route path="/new" render={() => <UsersC />} />
        <Route path="/login" render={() => <Login />} />
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  initialized: state.authPageApp.initialized,
});

export default compose(
  withRouter,
  connect(mapStateToProps, { initializedPageApp })
)(App);
